SET @percent = getPercentResponseByDimension(stdataID, dimID);

SET @areaID = getAreaIDByStudentID(stdataID);

SET @processID = (SELECT process_id FROM student_data WHERE id = stdataID);

SET @dimRankID = (SELECT id FROM dimension_ranks WHERE areas_id = @areaID AND dimensions_id = dimID AND process_id = @processID);

if (@dimRankID IS NULL) THEN
	INSERT INTO dimension_ranks VALUES (null, 0, @areaID, dimID, @processID);
    SET @dimRankID = (SELECT id FROM dimension_ranks WHERE areas_id = @areaID AND dimensions_id = dimID AND process_id = @processID);
END IF;

