CREATE DEFINER=`root`@`localhost` FUNCTION `percentAttendace`(stdtID int, groupID int) RETURNS tinyint(4)
BEGIN
	DECLARE percent TINYINT DEFAULT 0;

	SET @total = (SELECT count(1) FROM class_data WHERE groups_id = 2);
    
    IF (@total <> 0) THEN
		SET @present = (SELECT count(1) FROM attendance WHERE class_data_id IN (SELECT id FROM class_data WHERE groups_id = groupID) AND student_data_id = stdtID AND present = 1);
        SET percent = round(@present/@total * 100);        
    END IF;
RETURN percent;
END ;;
