CREATE DEFINER=`root`@`localhost` PROCEDURE `spDimensionsForLeveling`(stdt int)
BEGIN
	
    SET @stat = (SELECT IF(score < (SELECT percent * 4 FROM process WHERE id = process_id), 3, 1) as stat FROM student_data WHERE id = stdt);
    
    SELECT 
		name as dimension, 
        @stat as num, 
        (SELECT name FROM status WHERE id = @stat) as stat 
	FROM dimensions WHERE id IN (2, 3, 7) ORDER BY name ASC;

END ;;
