CREATE DEFINER=`root`@`localhost` PROCEDURE `spDimensionsOfStudent`(areaID int, procID int)
BEGIN
	-- Ya no es necesario pedir dimensionID porque, independientemente del valor ser la misma respuesta.
	SELECT

	 stdt.id as id,
	 stdt.code as code,
	 stdt.score as score,
	 concat(pl.lastname, ' ', pl.name) as student,
	 pg.name as program,
	 if ((score < pc.percent * 4), 3, 1) as num,
	 (select name from status where id = (if ((score < pc.percent * 4), 3, 1))) as stat
	 
	FROM student_data AS stdt
	JOIN students AS st ON st.id = stdt.students_id
		JOIN people AS pl ON pl.id = st.people_id
	JOIN programs AS pg ON pg.id = stdt.programs_id
		JOIN areas as ar ON ar.id = pg.areas_id
	JOIN process AS pc ON pc.id = stdt.process_id

	WHERE ar.id = areaID AND pc.id = procID

	ORDER BY ar.id ASC, pg.name ASC, stdt.score ASC;
END ;;
DELIMITER ;
