CREATE DEFINER=`root`@`localhost` PROCEDURE `spSaveNUpdateDirector`(in directorID smallint, _dni varchar(8), _name varchar(45), _lastname varchar(45), genderID tinyint, programID tinyint)
BEGIN

	IF directorID = 0 THEN
		
		SET @personID = (SELECT id FROM people WHERE dni = _dni);
        
        IF @personID IS NULL THEN
			INSERT INTO people VALUES (null, _dni, _name, _lastname, genderID);
			SET @personID = (SELECT id FROM people WHERE dni = _dni);
        END IF;
                
        IF (SELECT count(1) FROM directors WHERE people_id = @personID) = 0 THEN
			INSERT INTO directors (people_id, programs_id) VALUES (@personID, programID);
			INSERT INTO users (username, password, user_type_id, people_id) VALUES (_dni, sha1(_dni), 5, @personID );
        END IF;
        
    ELSE
            
        IF (SELECT count(1) FROM directors WHERE id = directorID) = 1 THEN
            UPDATE people SET dni = _dni, name = _name, lastname = _lastname, genders_id = genderID WHERE id = (SELECT people_id FROM directors WHERE id = directorID);
			UPDATE directors SET programs_id = programID WHERE id = directorID; 
        END IF;
    
    END IF;
END ;;
DELIMITER ;
