CREATE DEFINER=`root`@`localhost` PROCEDURE `spSaveNUpdateTeacher`(in teacherID smallint, _dni varchar(8), _name varchar(45), _lastname varchar(45), genderID tinyint, courseID tinyint, programID tinyint)
BEGIN

	IF teacherID = 0 THEN
		
		SET @personID = (SELECT id FROM people WHERE dni = _dni);
        
        IF @personID IS NULL THEN
			INSERT INTO people VALUES (null, _dni, _name, _lastname, genderID);
			SET @personID = (SELECT id FROM people WHERE dni = _dni);
        END IF;
                
        IF (SELECT count(1) FROM teachers WHERE people_id = @personID) = 0 THEN
			INSERT INTO teachers VALUES (null, @personID, courseID, programID, 1);
			INSERT INTO users (username, password, user_type_id, people_id) VALUES (_dni, sha1(_dni), 4, @personID );
        END IF;
        
    ELSE
            
        IF (SELECT count(1) FROM teachers WHERE id = teacherID) = 1 THEN
            UPDATE people SET dni = _dni, name = _name, lastname = _lastname, genders_id = genderID WHERE id = (SELECT people_id FROM teachers WHERE id = teacherID);
			UPDATE teachers SET courses_id = courseID, programs_id = programID WHERE id = teacherID; 
        END IF;
    
    END IF;
END ;;
