CREATE DEFINER=`root`@`localhost` PROCEDURE `spSaveQuestionsByStudent`(_num tinyint(4), stdataID mediumint(9), _rsp decimal(2, 1))
BEGIN

	SET @count = (SELECT count(1) from questions WHERE student_data_id = stdataID);
		
	IF (@count < 100) THEN

		SET @distID = (SELECT id FROM distributions WHERE areas_id = getAreaIDByStudentID(stdataID) AND (_num BETWEEN dfrom AND dto));

		SET @respID = (CASE
			WHEN _rsp = 0 THEN 3
			WHEN _rsp < 0 THEN 2
			WHEN _rsp > 0 THEN 1
			ELSE 3
		END);
		
		SET @countQst = (SELECT count(1) FROM questions WHERE number = _num AND student_data_id = stdataID AND responses_id = @respID AND distributions_id = @distID);
		
		IF (@countQst = 0) THEN
			INSERT INTO questions VALUES (null, _num, stdataID, @respID, @distID);
		END IF;
        
	END IF;
    
END ;;
DELIMITER ;
