CREATE DEFINER=`root`@`localhost` PROCEDURE `spStudentRequireLeveling`(proc VARCHAR(10), area varchar(1))
BEGIN
	
	SELECT 
		stdt.id, 
		stdt.code,
		stdt.score,
		pl.dni, 
		pl.name,
		pl.lastname,
        pg.name as program,
        ar.name as area
    FROM
    student_data AS stdt
    JOIN process AS pr ON pr.id = stdt.process_id
    JOIN programs AS pg ON pg.id = stdt.programs_id
		JOIN areas AS ar ON ar.id = pg.areas_id
    JOIN students AS st ON st.id = stdt.students_id
		JOIN people AS pl ON pl.id = st.people_id
    
    WHERE 
		pr.name = proc and 
        stdt.score < (pr.percent * 4) and
        ar.name = area        
    
    ORDER BY ar.name ASC, pl.lastname ASC;


END ;;
DELIMITER ;
